import './index.css'



const Testimonial = ({ text, name, photo }) => {
  return (
    <div className="testimonial">
      <p className="testimonial-text">{text}</p>
      <img className="testimonial-photo" src={photo} alt={name} />
      <p className="testimonial-name">{name}</p>
    </div>
  );
}

const Testimonials = () => {
  const testimonials = [
    {
      text: "I'm so happy with the service I received!",
      name: "John Doe",
      photo: "https://via.placeholder.com/150"
    },
    {
      text: "Amazing experience! Would definitely recommend!",
      name: "Jane Smith",
      photo: "https://via.placeholder.com/150"
    },
    {
      text: "Great job! Will be using again in the future.",
      name: "Bob Johnson",
      photo: "https://via.placeholder.com/150"
    },
  ];

  return (
    <div className="testimonials">
      <h2 className="testimonials-title">Client Testimonials</h2>
      {testimonials.map((testimonial, index) => (
        <Testimonial key={index} text={testimonial.text} name={testimonial.name} photo={testimonial.photo} />
      ))}
    </div>
  );
}

export default Testimonials;
